import React from 'react';
import ReactDOM from 'react-dom';
import './index.css';
import App from './App';
import { BrowserRouter as Router } from 'react-router-dom';
import Signup from './Signup';
import Routes from './Routes';

ReactDOM.render(
  <Router>
    <div className="App">
      <Signup />
      <App />
      <Routes />
    </div>
  </Router>,
  document.getElementById('root')
);
